#include <iostream>
#include <chrono>

// Интерфейс компонента
class Component {
public:
    virtual void operation() const = 0;
};

// Конкретная реализация компонента
class ConcreteComponent : public Component {
public:
    void operation() const override {
        std::cout << "Executing operation" << std::endl;
    }
};

// Абстрактный класс декоратора
class Decorator : public Component {
protected:
    Component* component;

public:
    Decorator(Component* component) : component(component) {}

    void operation() const override {
        component->operation();
    }
};

// Конкретный класс декоратора для измерения времени выполнения
class TimingDecorator : public Decorator {
public:
    TimingDecorator(Component* component) : Decorator(component) {}

    void operation() const override {
        auto start = std::chrono::high_resolution_clock::now();

        Decorator::operation(); // Вызываем операцию у декорируемого компонента

        auto end = std::chrono::high_resolution_clock::now();
        auto duration = std::chrono::duration_cast<std::chrono::microseconds>(end - start).count();
        std::cout << "Operation took " << duration << " microseconds" << std::endl;
    }
};

int main() {
    // Создаем компонент и декорируем его с помощью TimingDecorator
    Component* component = new ConcreteComponent();
    Component* decoratedComponent = new TimingDecorator(component);

    // Выполняем операцию
    decoratedComponent->operation();

    // Освобождаем память
    delete decoratedComponent;
    delete component;

    return 0;
}

