    }
};

// Абстрактный класс декоратора
class ShapeDecorator : public Shape {
protected:
    Shape* decoratedShape;

public:
    ShapeDecorator(Shape* shape) : decoratedShape(shape) {}

    void draw() const override {
        decoratedShape->draw();
    }
};

// Конкретные классы декораторов
class RedShapeDecorator : public ShapeDecorator {
public:
    RedShapeDecorator(Shape* shape) : ShapeDecorator(shape) {}

    void draw() const override {
        decoratedShape->draw();
        setRedBorder();
    }

private:
    void setRedBorder() const {
        std::cout << "Setting red border" << std::endl;
    }
};

class TransparentShapeDecorator : public ShapeDecorator {
