// Интерфейс наблюдателя
class Observer {
public:
    virtual void update(const std::string& message) = 0;
};

// Конкретный класс наблюдателя
class User : public Observer {
private:
    std::string name;

public:
    User(const std::string& name) : name(name) {}

    void update(const std::string& message) override {
        std::cout << name << " received a message: " << message << std::endl;
    }
};

// Интерфейс наблюдаемого объекта
class Subject {
private:
    std::vector<Observer*> observers;

public:
    void addObserver(Observer* observer) {
        observers.push_back(observer);
    }

    void removeObserver(Observer* observer) {
        // Найти и удалить наблюдателя из вектора
        auto it = std::find(observers.begin(), observers.end(), observer);
        if (it != observers.end()) {
            observers.erase(it);
        }
    }

    void notifyObservers(const std::string& message) {
        for (Observer* observer : observers) {
            observer->update(message);
        }
    }
};

int main() {
    // Создаем наблюдателей (пользователей)
    User* user1 = new User("John");
    User* user2 = new User("Alice");

    // Создаем наблюдаемый объект (систему уведомлений)
    Subject notificationSystem;

    // Подписываем пользователей на уведомления
    notificationSystem.addObserver(user1);
    notificationSystem.addObserver(user2);

    // Отправляем уведомление
    notificationSystem.notifyObservers("New notification!");

    // Отписываем одного пользователя
    notificationSystem.removeObserver(user2);

    // Отправляем еще одно уведомление
    notificationSystem.notifyObservers("Another notification!");

    // Освобождаем память
    delete user1;
    delete user2;

    return 0;
}

